import React from 'react'
import Container from 'react-bootstrap/Container';
import { Row } from 'react-bootstrap';

export const Keep = () => {
    return (
        <section className="mt-5">
        <Container>
            <Row className='justify-content-center flex-column align-items-lg-center '>
                <input type="text" className='bg-white text-dark rounded' style={{width:"450px", height:"60px"}}/>
                <textarea className='bg-white text-dark rounded' style={{width:"450px", height:"100px", resize:"none"}} ></textarea>
            </Row>
        </Container>
        </section>
    )
}
